// - react
import  React from 'react';
import { AuthContext} from '../../provider/data';

import './styles.css';

function App() {
  const { user }  = React.useContext(AuthContext);


  return (
    <div className="container w-auto">
     <ul>
       {user.map((user, indice) => (
        <>
         <li>{user.name.last}</li>
         <li>{user.id.name}</li>
         <li>{user.gender}</li>
        </>
       ))}
     </ul>
    </div>
  );
}

export default App;
